import React from 'react'
import styled from 'styled-components'

export const Content = ({ musicData, topArtistData }) => {
  console.log('musicdata', musicData)
  console.log('topaeasodkwejfpewf', topArtistData)
  return (
    <Container>
      <Box>
        <H1>DISCOVER</H1>
        <h2>My top artists</h2>
        {/* {topArtistData.items &&
          topArtistData.items.map(artist => <p>{artist.name}</p>)} */}
        {topArtistData.items &&
          topArtistData.items.map(artist => (
            <img
              style={{ width: '70px', height: '70px', borderRadius: '50%' }}
              src={artist.images[0].url}
            ></img>
          ))}
        <h2>Based on your music-taste</h2>
      </Box>
    </Container>
  )
}

export default Content

export const Container = styled.div`
  display: flex;
  padding: 2%;
`

export const H1 = styled.h1`
  color: white;
`

export const Box = styled.div`
  display: flex;
  flex-direction: column;
`
